// UpdateContact.js
import React, { useState, useEffect } from 'react';
import CreateContact from './CreateContact';
import EditContact from './EditContact';
import ProfileImageInput from './ProfileImageInput'; // Import the new component

function UpdateContact() {
  // ... (other code remains the same)

  const handleProfileImageChange = (e) => {
    // Handle profile image selection
    const file = e.target.files[0];
    // You can handle the selected profile image here as needed
  };

  return (
    <div>
      <h1>AddressBook</h1>
      <div className="container">
        <div className="search-container">
          {/* ... (other code remains the same) */}
        </div>
        <div className="create-container">
          <CreateContact />
        </div>
      </div>
      {searchTerm === '' ? (
        <table>
          <thead>
            <tr>
              <th>Profile</th>
              <th>Name</th>
              <th>Mobile No</th>
              <th>Email</th>
              <th>Address</th>
            </tr>
          </thead>
          <tbody>
            {data.map((item) => (
              <tr key={item.Id}>
                <td>
                  <ProfileImageInput onChange={handleProfileImageChange} />
                </td>
                <td>{item.Name}</td>
                <td>{item.Mobileno}</td>
                <td>{item.Email}</td>
                <td>{item.Address}</td>
                <td>
                  <button onClick={() => handleEditClick(item.Id)}>Edit</button>
                  {editingItemId === item.Id && (
                    <EditContact
                      contact={item}
                      onEditComplete={handleEditComplete}
                    />
                  )}
                </td>
                <td>
                  <button onClick={() => handleDelete(item.Id)}>Delete</button>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      ) : (
        filteredData.length > 0 ? (
          <ul>
            {filteredData.map((item) => (
              <li key={item.Id}>
                <p>
                  <ProfileImageInput onChange={handleProfileImageChange} />
                </p>
                <p>ID: {item.Id}</p>
                <p>Name: {item.Name}</p>
                <p>Email: {item.Email}</p>
                <p>Mobile No: {item.Mobileno}</p>
                <p>Address: {item.Address}</p>
                <button onClick={() => handleEditClick(item.Id)}>Edit</button>
                {editingItemId === item.Id && (
                  <EditContact
                    contact={item}
                    onEditComplete={handleEditComplete}
                  />
                )}
                <button onClick={() => handleDelete(item.Id)}>Delete</button>
              </li>
            ))}
          </ul>
        ) : null
      )}
    </div>
  );
}

export default UpdateContact;
